package main

import "testing"

var cases = []struct {
	s1, s2 string
	e      int
}{
	{"A", "B", 0},
	{"A", "A", 1},
	{"HARRY", "SALLY", 2},
	{"AA", "BB", 0},
	{"SHINCHAN", "NOHARAAA", 3},
	{"ABCDEF", "FBDAMN", 2},
	{"OUDFRMYMAW", "AWHYFCCMQX", 2},
	{"WEWOUCUIDGCGTRMEZEPXZFEJWISRSBBSYXAYDFEJJDLEBVHHKS", "FDAGCXGKCTKWNECHMRXZWMLRYUCOCZHJRRJBOAJOQJZZVUYXIC", 15},
	{"", "", 321},
	{"", "", 1618},
}

func TestMaxCommonSubstringLen(t *testing.T) {
	for _, c := range cases {
		g := maxCommonSubtringLen(c.s1, c.s2)
		if g != c.e {
			t.Errorf("%q, %q, Expected: %d, Got: %d", c.s1, c.s2, c.e, g)
		}
	}
}
